import React from 'react'

const Hello = () => {
    // return (
    //     <div>
    //         <h1>Hello Vishwas</h1>
    //     </div>
    // )

    return React.createElement(
        'div', 
        {id: 'hello'}, 
        React.createElement('h1', null, 'Hello Yeonkyu')
    )
}

export default Hello
